import React from "react"


export default function Table(props) {
    return (
        <div style={{ marginLeft: '25%' }}>
            <table>
                <thead>
                <tr>
                    {props.headings.map((item) => {
                        return 
                            <td style={props.style}>
                                <h3>{item}</h3>
                            </td>

                    })}
                    </tr>
                </thead>
                <tbody>
                    {props.newArr.map((item, i) => {
                        return <tr key={i}>
                            <td style={props.style}>{item.title}</td>
                            <td style={props.style}><a href="#" onClick={(e) => props.onChangeView(e, i)}>{item.username}</a></td>
                        </tr>
                    })}
                </tbody>
            </table>
        </div>
    )
}
